import { getClientToken } from "../clients/authenticationClient"

export default function Welcome() {
    const [clientToken, setClientToken] = useState("token");

    useEffect(() => {
        let token = getClientToken();
        setClientToken(token);
    }, [])

    return(
        <div>
            {/* <button onClick={(() => getClientToken())}>get token</button> */}
            <p>your token is {clientToken}</p>
        </div>
    )
}
